import './Navbar.css'
import {Link} from 'react-router-dom'
import styled from 'styled-components'
import Button from 'react-bootstrap/Button';

const StyledLink = styled(Link)`
    color: Black;
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    text-decoration:none;
    margin: 1px;
    position: SpeechRecognitionAlternative;
    font-size: 20px;
    `;


const Navbar = () => {
    return(
       <div className="main-container">
            <nav className="navbar navbar-expand-sm navbar-light bg-transparent">
                <div className="collapse navbar-collapse" id ="navbarNav">
                    <a className="navbar-brand" href="index.html">
                    <img src={"src/assets/Mug_Mr_And_Mrs_Koi.jpg"} alt="" height = "100" /> 
                    </a>
                        <div className="links">

                            <StyledLink to="/">Home</StyledLink>
                            <StyledLink to="/pens">Pens</StyledLink>
                            <StyledLink to="/pencils">Pencils</StyledLink>
                            <StyledLink to="/stickers">Stickers</StyledLink>
                            <StyledLink to="/journal">Journalling Acessories</StyledLink>
                            <StyledLink to="/organization">Organization Sets</StyledLink>
                            <StyledLink to="/blog">Blog</StyledLink>
                            <StyledLink to="/contact">Contact Us</StyledLink>
                            <Button><img src={"https://www.freeiconspng.com/thumbs/cart-icon/basket-cart-icon-27.png"} alt="" height = "35" ></img></Button>


                        </div>
                    <a className="navbar-cart" href="checkout.html">

                           </a>

                </div>

            </nav>
       </div>
    )
}

export default Navbar
